const {LoginRequest, LoginResponse} = require('./generated/proto/userhandler_pb');
const {UserHandlerClient} = require('./generated/proto/userhandler_grpc_web_pb');

var userService = new UserHandlerClient('http://localhost:8081');


export function loginWithToken(token){

	var request = new LoginRequest();
	request.setGoogleToken(token);

	userService.login(request, {}, function(err, response) {
	  // ...
	  console.log(err)
	  console.log(response)
	});
}
